import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
import '../index.css';


const gridExamplesPage = () => {
    return (
        <MDBContainer>
          <MDBRow >
              {/** Wishes Dropdown Button */}
            <MDBCol style={{ paddingLeft: 0 }} >
            <div class="btn-group">
  <button type="button" class="btn dropcolor">E</button>
  <button
    type="button"
    class="btn dropcolor dropdown-toggle dropdown-toggle-split"
    data-mdb-toggle="dropdown"
    aria-expanded="false"
  >
    <span class="visually-hidden"></span>
  </button>
  <ul class="dropdown-menu">

  </ul>
</div>
            </MDBCol>
            <MDBCol>2 of 2</MDBCol>
          </MDBRow>
          <MDBRow>
            <MDBCol>1 of 2</MDBCol>
            <MDBCol>2 of 2</MDBCol>
          </MDBRow>

        </MDBContainer>
    );
  }

  export default gridExamplesPage;
